import React from 'react';

class Action extends React.Component {
    constructor(props) {
        super(props);
    }
    displayIfActionMatches() {
        if (this.props.action === '/' + document.URL.split(/\//)[4])
            return this.props.children;
    }
    render() {
        return(
            <div>
                { displayIfActionMatches() }
            </div>
        )
    }
}

export default Action;
